<script>
 
function log(message) {
    var footer = document.getElementById('console');
    footer.innerHTML += '<br>' + message;
    return;
    var filters = (message);
    filters.forEach(function(obj, index){
        footer.innerHTML += '<br>' + (index);
    for (var key in obj){
        footer.innerHTML += '<br>' + (key, obj[key]);
    }
}); 
    footer.innerHTML += '<br>' + message;
}
</script>
